import Home from "./Pages/Home/Home";
import { Route, Redirect,Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Route path="/">
        <Redirect path="/home" />
      </Route>
      <Route path="/home">
        <Home />
      </Route>
    </>
  );
}

export default App;
